import React, { useState } from "react";
import {
  Link,
  Switch,
  Route,
  BrowserRouter as Router,
  Routes,
} from "react-router-dom";

import Profile from "./Screens/Profile";

import {
  Menu,
  MenuItem,
  ProSidebar,
  SidebarHeader,
  SubMenu,
} from "react-pro-sidebar";
import "react-pro-sidebar/dist/css/styles.css";

export const Header = () => {
  return (
    <>
      <div>
        <ProSidebar collapsed={false}>
          <Router>
            <Menu iconShape="square">
              <MenuItem
                icon={
                  <Icon
                    alt="Dashboard"
                    imgUrl="https://cdn-icons.flaticon.com/png/512/2930/premium/2930735.png?token=exp=1659140861~hmac=564dcdb925c5d27c39e98285b04fd6dd"
                  />
                }
              >
                Dashboard
                <Link to="/" />
              </MenuItem>
            </Menu>
            <Menu iconShape="square">
              <SubMenu
                icon={
                  <Icon
                    alt="Profile"
                    imgUrl="https://cdn-icons-png.flaticon.com/512/1077/1077012.png"
                  />
                }
                title="Profile"
              >
                {" "}
                <MenuItem>
                  Employee Name
                  <Link to="/profile" />
                </MenuItem>
                <MenuItem>Address</MenuItem>
              </SubMenu>
            </Menu>

            <Routes>
              <Route path="/" element={<Dashboard />} />
              <Route path="/profile" element={<Profile />} />
            </Routes>
          </Router>
        </ProSidebar>
      </div>
    </>
  );
};

const Icon = ({ imgUrl, alt }) => {
  return (
    <img
      alt={alt}
      src={imgUrl}
      style={{
        width: 30,
        height: 30,
        background: "rgba(255,255,255,0.8)",
      }}
    />
  );
};
